<!doctype html>
            <html class="h5p-iframe">
            <head>
                <meta charset="utf-8">                    
                <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/api/v1/h5p/ajax?action=","contents":{"cid-3773702960":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"icon\",\"icon\":\"plus\",\"color\":\"#27bb09\",\"hotspots\":[{\"position\":{\"x\":30.976430976430976,\"y\":75.3716041753702},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Die divergenten Plattengrenzen sind jene, die sich voneinander wegbewegen und sich dabei trennen. Dabei entsteht neue Lithosphäre, also neuer Erdboden (Grotzinger &amp; Jordan 2017: S. 28). Sie werden deshalb auch konstruktive Plattengrenzen genannt (Schellmann 2012: S.368). Es können dabei ozeani- sche Platten mit ozeanischen Platten oder kontinentale mit kontinentalen Platten kombiniert werden (Grotzinger &amp; Jordan 2017: S.29).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"3fefbb08-716c-43cb-bdec-ae1d046cb5d2\"}],\"header\":\"Divergente Plattengrenzen\"},{\"position\":{\"x\":60.77441077441077,\"y\":49.70527694610779},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Am Meeresboden ist die Grenze zwischen sich trennenden ozeanischen Platten durch einen mittelozeanischen Rücken, eine untermeerisches Gebirgskette mit aktivem Vulkanismus, Erdbeben und Riftvorgängen gekennzeichnet – Prozesse, die insgesamt durch Dehnungskräfte der Konvektionsbewegungen im Erdmantel verursacht werden. Wenn sich der Meeresboden trennt, steigt heißes geschmolzenes Gestein – also Magma – in die Riftstrukturen auf und bildet neue ozeanische Kruste (Grotzinger &amp; Jordan 2017: S. 28). Ein Beispiel dafür ist der Mittelatlantische Rücken, an dem sich die Nordamerikanische und die Eurasische Platte trennen und durch aufsteigendes Mantelmaterial neuer Meeresboden entsteht. Durch Seafloor-Spreading an den mittelozeanischen Rücken sind die vielen Millionen Quadratkilometer ozeanischer Kruste entstanden, die heute den Boden der Ozeane bilden (ebd.: S. 29)</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"86fe48f3-bf57-4182-9a08-d017f6a46cd0\"}],\"header\":\"Ozeanische Spreading-Zentren\"},{\"position\":{\"x\":59.93265993265994,\"y\":13.304604453882932},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Durch die Trennung der Nordamerikanischen und der Eurasischen Platte steigt Mantelmaterial auf und neuer Meeresboden wird gebildet. Dadurch entstand der Mittelatlantische Rücken. Auf Island tritt ein Abschnitt des ansonsten unter Meeresbedeckung liegenden Mittelatlantischen Rückens zutage und bietet daher die seltene Möglichkeit, die Prozesse der Plattentrennung und des Seafloor-Spreading unmittelbar zu beobachten. Der Mittelatlantische Rücken findet nördlich von Island im Nordpolarmeer seine Fortsetzung und verbindet sich dort mit einem nahezu erdumfassenden, etwa 600.000 km langen System mittelozeanischer Rücken, die den Indischen und Pazifschen Ozean durchziehen und schließlich an der Westküste Nordamerikas enden (Grotzinger &amp; Jordan 2014: S. 29).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9b407322-edfd-417c-afb4-5cd981b1c3f9\"}],\"header\":\"Der Mittelatlantische Rücken\"},{\"position\":{\"x\":73.23232323232324,\"y\":41.019886099893235},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Doch nicht nur ozeanische Platten können sich voneinander entfernen. Es gibt auch divergente Plattengrenzen kontinentaler Platten. Frühe Stadien der Plattentrennung findet man auf nahezu allen Kontinenten. Markantestes Beispiel sind die großen Grabenstrukturen in Ostafrika. Diese divergenten Plattengrenzen sind durch langgestreckte Grabensenken, sogenannte Rift-Valleys, durch vulkanische Tätigkeit und durch Erdbeben gekennzeichnet, die sich jedoch über einen größeren Bereich erstrecken als an den ozeanischen Spreading-Zentren. Das Rote Meer und der Golf von Kalifornien sind ebenfalls solche Riftstrukturen, die heute noch auseinanderdriften. In beiden Fällen haben sich die Kontinente schon so weit entfernt, dass sich im Rift an der Spreading-Achse neuer Ozeanboden gebildet hat und die Grabensenken vom Meer überflutet worden sind (Grotzinger &amp; Jordan 2014: S. 29).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"fa2b01f5-4195-439a-8d77-87fb073f2ba4\"}],\"header\":\"Plattentrennung auf den Kontinenten\"},{\"position\":{\"x\":66.66666666666666,\"y\":23.476847177737547},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Gelegentlich kann sich auf den Kontinenten die Grabenbildung oder das sogenannte Rifting verlangsamen oder zum Stillstand kommen, noch bevor ein Kontinent völlig auseinanderbricht und ein neuer Ozean sich öffnet. Solche Riftstrukturen, die gewissermaßen in einem Frühstadium stecken bleiben, werden als abgebrochene Riftstrukturen („aborted rifts“ oder „failed rifts“) bezeichnet. Der Oberrheingraben ist nur noch schwach aktiv und könnte ein Beispiel für eine zur Ruhe gekommene Riftstruktur sein (Grotzinger &amp; Jordan 2014: S. 29).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8f99b50f-e441-4fe2-9a45-87a8853a2dac\"}],\"header\":\"Failed Rifts\"}],\"hotspotNumberLabel\":\"Hotspot Nummer #num\",\"closeButtonLabel\":\"Schließen\",\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB4AAAA
